import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
  rot: {
    maxWidth: '100%'
  },
  media: {
    height: 0,
    paddingTop: '56.25%'
  },
  cardContent: {
    display: 'flex',
    justifyContent: 'space-between',
  },
  cartActions: {
    display: 'flex',
    justifyContent: 'flex-end',
  },
  buttons: {
    display: 'flex',
    alignItems: 'center',
  },
}));
